-- ----------------------------
--  Table structure for `demand_group`
-- ----------------------------
DROP TABLE IF EXISTS `demand_group`;
CREATE TABLE `demand_group` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `group_id` int(10) NOT NULL COMMENT '分组编号',
  `category_id` int(5) NOT NULL COMMENT '分类编号',
  `name` varchar(100) NOT NULL COMMENT '分组名称',
  `sort` int(5) NOT NULL COMMENT '排序',
  `flag` int(1) NOT NULL DEFAULT '1' COMMENT '是否可用',
  PRIMARY KEY (`id`,`category_id`),
  KEY `name_index` (`name`),
  KEY `category_id` (`category_id`),
  CONSTRAINT `category_id_foreignkey` FOREIGN KEY (`category_id`) REFERENCES `demand_category` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=94 DEFAULT CHARSET=utf8 COMMENT='分类分组';

